setlastnormal=function(key)
	lastnormal=key
	coroutine.resume(coroutine.create(function(k,kt)
		while k == lastnormal do
			if kt + 1.2 < tick() then
				break
			end
			wait()
		end
		lastnormal=""
		--print("Done")
	end),lastnormal,tick())
end

