SetCombatKey=function(k)
	PlayerCombatKeys[k]=true
	coroutine.resume(coroutine.create(function(k)
		for i=1, 1000 do
			wait(.01)
			if PlayerCombatKeys[k]==nil then
				break
			end
		end
		PlayerCombatKeys[k]=nil
	end),k)
end

