		<Item class="ModuleScript" referent="RBX0832241AD88A47959D3D8A8C4CBE923B">
			<Properties>
				<Content name="LinkedSource"><null></null></Content>
				<string name="Name">Notes&amp;Credits</string>
				<string name="ScriptGuid"></string>
				<ProtectedString name="Source"><![CDATA[--[[
	Credits for Outsourced Functions / Etc.
	
	Wedge-Ribbon Tracer - Fenrier (Modifications made)
--]]

--[[
	
	Developer notes
	
	v.6
	Optimized certain performance aspects.
	
	-Script CPU hogging reduced from an observed
	 maximum of 25% to a more acceptable 10%
	-Reduced PCPM for the Cloak
	-Tied Cloak physics checks into RenderStepped
	-Disabled ribbon tracer effect
	-Reduced effects for "Ordnance Black"
	
	v.62
	-Added a better method for detecting characters
	-Added an actual jump animation
	-Swapped all 'wait()'-s regarding block animations with Heartbeat waits, for better or worse
--]]]]></ProtectedString>
			</Properties>
